package com.leetcode.facebook.stringsandarrays;

import java.util.Stack;

/**
 * Given a non-empty string s, you may delete at most one character. Judge whether you can make it a palindrome.

 Example 1:
 Input: "aba"
 Output: True
 Example 2:
 Input: "abca"
 Output: True
 Explanation: You could delete the character 'c'.
 Note:
 The string will only contain lowercase characters a-z. The maximum length of the string is 50000.

 * @author Santosh Manughala (SM030146).
 */
public class StringPalindromeII {

    public static void main(String args[]) {
//        String input = "abc";
//        String input = "abca";
//        String input = "aacbbacaa";
//        String input = "";
//        String input = "";


//        String input = "abcba";
//        String input = "abcbad";
//        String input = "dabcba";
//        String input = "abbca";
//        String input = "abbac";
//        String input = "eeccccbebaeeabebccceea";
        String input = "ab";
        if(null == input || input.length() > 50000) {
            throw new IllegalArgumentException("input is null or greater than 50000 chars");
        }

        if(input.length() <= 1) {
            // since we can remove atmost one char, considering it is a palidrome
            System.out.println("is palindrome: " + true);
        }

//        boolean result = isPalindromeIIBruteForce(input);
        boolean result = isPalindromeIIBestCase(input);

        System.out.println("is palindrome: " + result);
//        System.out.println("is palindrome: " + validPalindrome(input));
    }

    // will take forever to run if there are more than 2000 chars
    // Time O(n^2)
    private static boolean isPalindromeIIBruteForce(String input) {
        if(isPalindrome(input)) {
            return true;
        } else {
            StringBuilder builder = new StringBuilder(input);
            for(int i = 0; i < input.length(); i++) {
                char temp = input.charAt(i);
                builder.deleteCharAt(i);
                if(isPalindrome(builder)) {
                    return true;
                }
                builder.insert(i, temp);
            }
            return false;
        }
    }

    private static boolean isPalindrome(CharSequence input) {
        int i = 0, j = input.length() - 1;
        while(i<j) {
            if(input.charAt(i++) != input.charAt(j--)) {
                return false;
            }
        }
        return true;
    }

    private static boolean isPalindromeRange(String input, int i, int j) {
        while(i<j) {
            if(input.charAt(i++) != input.charAt(j--)) {
                return false;
            }
        }
        return true;
    }

    // Time O(n)
    private static boolean isPalindromeIIBestCase(String input) {
        int i = 0, j = input.length() - 1;
        while(i<j) {
            if(input.charAt(i) != input.charAt(j)) {
                return isPalindromeRange(input, i+1, j) || isPalindromeRange(input, i, j-1);
            }
            i++;
            j--;
        }
        return true;
    }

}
